import testImage from "../svg/test.svg";
import TodaysForecast from "./TodaysForecast";
import DetailedForecast from "./DetailedForecast";

const Forecast = () => {
    return (  
        <div>
            {/* window for forecast */}
            <div>
                {/* city and forecast */}
                <div>
                    <div>Tbilisi</div>
                    <div>Sunny</div>
                    
                    <img src={testImage} alt="icon not found" />

                    <div>31°</div>
                </div>

                <TodaysForecast />
                <DetailedForecast />
            </div>
        </div>
    );
}
 
export default Forecast;

